import React from 'react';
import { ArticulosContext, ArticulosTienda } from './hooks/ArticulosTienda';
import GlobalRouter from './GlobalRouter';

function App() {
  const { articulos } = ArticulosTienda();

  return (
    <ArticulosContext.Provider value={{ articulos }}>
      <GlobalRouter />
    </ArticulosContext.Provider>
  );
}

export default App;
